
Clear-Content ".\patching_report.html" -ErrorAction SilentlyContinue

$time=get-date -Format MM/dd/yyyy
$caption= "CLEANHARBORS - Servers Patch Status Report"


convertto-html -body  "<html><center><br><h3 style='color:white;background-color:blue'>$caption<br></h3>"|out-file ".\patching_report.html" -append 
convertto-html -body  "<html><center><br><h3><img src='data:image/gif;base64,' height='112' width='98'><br></h3><h3>Generated on $time</h3><br><table border=2 style='table-layout:fixed;background-color:yellow'><tr><h3><th width='150px'>Server</th><th width='160px'>OS Diskspace</th><th width='170px'>OS Version</th><th width='150px'>Last Boot Time(EST)</th><th width='250px' bgcolor='yellow'>Hotfix (Last 7 days)</h3></th></tr>" |out-file ".\patching_report.html" -append 

$server=gc ".\serverList.txt"

foreach ($srv in $server)
{
 if( Test-Connection -ComputerName $srv -Quiet -Count 3)
 {
 try{
 write-host "Collecting data from $srv.." -foregroundcolor green 
 $patch=get-hotfix -ComputerName $srv |Select HotfixID,installedon | where-object{$_.installedon -gt (get-date).AddDays(-35)} |ft -hidetableheaders| out-file .\hotfixInfo.txt
 $patch=gc .\hotfixInfo.txt
 
 
  
 #$patch=get-hotfix -ComputerName $srv |Select HotfixID,installedon 
 $boot=invoke-command -computername $srv -scriptblock{(get-CimInstance -ClassName win32_operatingsystem).lastbootuptime}
 $lastboot=[System.TimeZoneInfo]::ConvertTimeBySystemTimeZoneId((Get-Date -Date $boot), 'Eastern Standard Time')
 $os=invoke-command -computername $srv -scriptblock{(get-CimInstance -ClassName win32_operatingsystem).caption}
 $srvModel=invoke-command -computername $srv -scriptblock{(gwmi win32_computersystem).manufacturer}
 #$OsDrive=invoke-command -computername $srv -scriptblock{Get-Volume -DriveLetter C | Select-Object @{name="Total Size(GB)";expression={[math]::Round(($_.size /1GB),2)}},@{name="Free Space(GB)";expression={[math]::Round(($_.sizeremaining /1GB),2)}}}
 $OsDrive=invoke-command -computername $srv -scriptblock{Get-Volume -DriveLetter C | Select-Object @{name="Free Space(GB)";expression={[math]::Round(($_.sizeremaining /1GB),2)}}}|ft -hidetableheaders|out-file diskspace.txt 
 #gc .\diskspace.txt| Foreach {$_. TrimEnd()} | Set-Content freespace.txt
 (gc -Path .\diskspace.txt) | ? {$_.trim() -ne "" } | set-content -Path .\freespace.txt
 $str1 = gc .\freespace.txt
 $str=$str1.Trim() | set-content .\new.txt
 $abc=gc .\new.txt
 $C_freespace=$abc.SubString(0,4)
 $freespace="C:\ Free space: $C_freespace GB"
 
 $winService=(Get-Service wuauserv -computername $srv).status
 $serviceStatus="Windows Update Service: $winService"
 
 <#
 convertto-html -body "<table border=2 style='table-layout:fixed;background-color:lavender'>
<tr><td style='width:150px'>$srv</td><td style='width:150px'>$srvModel</td><td style='width:150px'>$OsDrive <br><br><br> $serviceStatus</td><td style='width:170px'>$os</td><td style='width:190px'>$lastboot</td>
<td style='width:250px'>$ans</td></tr>
</center></table>" |out-file ".\patching_report.html"  -append -EA silentlycontinue

#>
convertto-html -body "<table border=2 style='table-layout:fixed;background-color:lavender'>
<tr><td style='width:150px'>$srv<br><br>$srvModel</td><td style='width:160px'>$freespace <br><br><br> $serviceStatus</td><td style='width:170px'>$os</td><td style='width:150px'>$lastboot</td>
<td style='width:250px'>$patch</td></tr>
</center></table>" |out-file ".\patching_report.html"  -append -EA silentlycontinue

Clear-Content ".\hotfixInfo.txt" -ErrorAction SilentlyContinue
Clear-Content ".\diskspace.txt" -ErrorAction SilentlyContinue
Clear-Content ".\freespace.txt" -ErrorAction SilentlyContinue
Clear-Content ".\new.txt" -ErrorAction SilentlyContinue
 }
 
 catch
 {
  write-host "Error :Unable to fetch from $srv" -foregroundcolor cyan
  $srv| out-file .\unreachable_hosts.txt -append
 }

}

#If Else End
else {Write-host "Unable to connect server $srv" -BackgroundColor DarkBlue;$srv| out-file .\unreachable_hosts.txt -append}

} #foreach end

#Remove temp files
write-host "Completed fetching report from the servers.." -foregroundcolor yellow
remove-item .\diskspace.txt -ErrorAction SilentlyContinue
remove-item .\final.txt -ErrorAction SilentlyContinue
remove-item .\freespace.txt -ErrorAction SilentlyContinue
remove-item .\hotfixinfo.txt -ErrorAction SilentlyContinue
remove-item  .\new.txt -ErrorAction SilentlyContinue
invoke-item .\patching_report.html -ErrorAction SilentlyContinue

#Exit from the script
exit

